// SPDX-License-Identifier:MIT

pragma solidity ^0.8;

contract testArray{
    uint[] public num;
    uint[3] public numFixed;

    uint[] public num1 = [1,2];
    uint[3] public numFixed1 = [3,4,5]; 

    // num.push(uint(1));
    // num.push(1);
    // num[2]=777;//这句话放在函数外怎么不行 

    // delete numFixed1[1];  ParserError: Function, variable, struct or modifier declaration expected

    uint[5] public c;

    function example()external{
        num.push(1);//动态数组像尾部添加数据，和Go的append相似
        num.push(2);
        num.push(3);

        // num[3]=777;  会报错，因为下标为3的内存还没被创建
        num[0] = 777; 

        delete num[0];//删除  但是不会减少长度  改成默认值
        num.pop();  //弹出最后一个元素  但是会减少数组的长度

        uint len = num.length;

        // 局部变量
        uint[] memory  a =new uint[](5); //函数中不能创建动态数组  要指定长度
        // 局部的数组 push 和pop都不能用  会改变长度
        a[len]=1;

        // 局部变量中只能定义状态数组

    }


}

